    "content": "\rD3_PERSONScontains the cleaned version of PERSONS, where birth date and death date are reconstituted as dates\nD3_events_DEATH\rD3_output_spells_category\rconceptsetdatasetthese are multiple datasets, one per each conceptset, which is a value in the list c(conceptsets_exact_matching, conceptsets_children_matching), set in 07_algorithms. Each conceptset dataset is named after the conceptset. Each conceptset is associated to a list of codes. The dataset is obtained by retrieving records from the CDM bearing a code that match one of the codes in the codelist. The matching can be exact (for the conceptsets in conceptsets_exact_matching) or per ascendant (for conceptsets in conceptsets_children_matching) . Records are retrieved from the EVENTS table, but also from other tables which may bear a record, such as PROCEDURES or VACCINES\nitemsetdataset\rpromptsetdataset\rD3_clean_vaccinesThis dataset contains all the records of a COVID vaccine, including their imputation and modifications and exclusion criteria. Exclusion criteria must be applied before using the variable in the next steps\nD3_vaccines_curatedThis dataset contains only the records of a COVID vaccine that enter the study\nD5_Flowchart_criteria_for_dosesFlowchart of the exlusion of covid vaccines records\nD3_clean_all_vaccinesThis dataset contains the records of all the curated doses of all vaccines in the instance listed in Table 4 of the SAP, including the curated covid vaccines. It is obtained from the original conceptsets datastes by replicating each vaccination record as many times as the indicators that it is used for, see the first example in the tab Example: a record with Vacco Id DIP-HIB-PER-POL-TET is replicated 3 times, once per the indicator DPT, once per the indicator HiB, and once for the indicator Pol. Then, each record is labelled with various exclusion citeria, most importantly, records with dats 30 daya apart form a previous record as marked as 'duplicates'. In the next step, all the record labelled as 'removed row' will be removed\nD3_all_vaccines_curatedThis dataset contains the records of all the curated doses of all roots of indicators in the instance listed in Table 7 of the SAP. Doses of covid vaccines are included. It is obtained by D3_clean_all_vaccines by excluding records that are duplicates or of bad quality, and after appending the curated covid vaccines\nD5_Flowchart_criteria_for_all_vaccines\rD3_clean_spells\rD3_selection_criteria_from_PERSONS_to_source_population\r ",
